import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../../hooks/useAuth';

const Navbar = () => {
  const { user, logout } = useAuth();
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);
  const navigate = useNavigate();

  const handleLogout = async () => {
    await logout();
    navigate('/');
  };
    const handleProfileClick = () => {
    if (user?.role === 'etudiant') {
      navigate('/profil/etudiant');
    } else if (user?.role === 'enseignant') {
      navigate('/profil/enseignant');
    } else {
      navigate('/connexion');
    }
  };

  return (
    <header className="bg-est-blue text-white shadow-md sticky top-0 z-50">
      <div className="container mx-auto px-4 py-4">
        <div className="flex justify-between items-center">
          <div className="flex items-center">
            <img src="/assets/images/logo.png" alt="Logo EST Salé" className="h-10 mr-3" />
            <Link to="/" className="text-xl md:text-2xl font-bold">EST Salé</Link>
          </div>
          
          {/* Desktop Navigation */}
          <nav className="hidden md:flex space-x-1 lg:space-x-6 items-center">
            <Link to="/" className="px-3 py-1 rounded hover:bg-est-light-blue hover:bg-opacity-30 transition">Accueil</Link>
            <Link to="/formations" className="px-3 py-1 rounded hover:bg-est-light-blue hover:bg-opacity-30 transition">Formations</Link>
            <Link to="/admission" className="px-3 py-1 rounded hover:bg-est-light-blue hover:bg-opacity-30 transition">Admission</Link>
            <Link to="/recherche" className="px-3 py-1 rounded hover:bg-est-light-blue hover:bg-opacity-30 transition">Recherche</Link>
            
            {user ? (
              <div className="relative group">
                <button 
                className="flex items-center space-x-2 px-3 py-1 rounded hover:bg-est-light-blue hover:bg-opacity-30 transition">
                  <span>Mon Profil</span>
                  <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5" viewBox="0 0 20 20" fill="currentColor">
                    <path fillRule="evenodd" d="M10 9a3 3 0 100-6 3 3 0 000 6zm-7 9a7 7 0 1114 0H3z" clipRule="evenodd" />
                  </svg>
                </button>
                <div className="absolute right-0 mt-2 w-48 bg-white rounded-md shadow-lg py-1 z-50 hidden group-hover:block">
                  <Link 
                    to={user.role === 'etudiant' ? '/profil/etudiant' : '/profil/enseignant'} 
                    className="block px-4 py-2 text-gray-800 hover:bg-gray-100"
                  >
                    Profil
                  </Link>
                  <button
                    onClick={handleLogout}
                    className="block w-full text-left px-4 py-2 text-gray-800 hover:bg-gray-100"
                  >
                    Déconnexion
                  </button>
                </div>
              </div>
            ) : (
              <Link to="/connexion" className="px-3 py-1 bg-est-yellow text-black rounded hover:bg-yellow-600 transition">
                Connexion
              </Link>
            )}
          </nav>
          
          {/* Mobile menu button */}
          <button 
            id="mobileMenuButton" 
            className="md:hidden text-white focus:outline-none"
            onClick={() => setMobileMenuOpen(!mobileMenuOpen)}
          >
            <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M4 6h16M4 12h16M4 18h16"></path>
            </svg>
          </button>
        </div>
        
        {/* Mobile Navigation */}
        <div id="mobileMenu" className={`md:hidden bg-est-blue ${mobileMenuOpen ? 'max-h-screen' : 'max-h-0'} overflow-hidden transition-all duration-300`}>
          <div className="flex flex-col space-y-2 px-4 py-3">
            <Link to="/" className="px-3 py-2 rounded hover:bg-est-light-blue hover:bg-opacity-30 transition">Accueil</Link>
            <Link to="/formations" className="px-3 py-2 rounded hover:bg-est-light-blue hover:bg-opacity-30 transition">Formations</Link>
            <Link to="/admission" className="px-3 py-2 rounded hover:bg-est-light-blue hover:bg-opacity-30 transition">Admission</Link>
            <Link to="/recherche" className="px-3 py-2 rounded hover:bg-est-light-blue hover:bg-opacity-30 transition">Recherche</Link>
            
            {user ? (
              <>
                <Link 
                  to={user.role === 'etudiant' ? '/profil/etudiant' : '/profil/enseignant'} 
                  className="px-3 py-2 rounded hover:bg-est-light-blue hover:bg-opacity-30 transition"
                >
                  Mon Profil
                </Link>
                <button
                  onClick={handleLogout}
                  className="px-3 py-2 text-left rounded hover:bg-est-light-blue hover:bg-opacity-30 transition"
                >
                  Déconnexion
                </button>
              </>
            ) : (
              <Link to="/connexion" className="px-3 py-2 bg-est-yellow text-black rounded hover:bg-yellow-600 transition text-center">
                Connexion
              </Link>
            )}
          </div>
        </div>
      </div>
    </header>
  );
};

export default Navbar;
